module frameBufferTB;
    // Write to frame inputs
    reg [18:0] writeBus;
    reg [2:0] R_write;
    reg [2:0] G_write;
    reg [1:0] B_write;
    // Output frame I/O
    reg [18:0] index;
    wire [2:0] R_read;
    wire [2:0] G_read;
    wire [1:0] B_read;
    // Clock
    reg CLK;
    
    
    frameBuffer testBuffer(writeBus, R_write, G_write, B_write, index, R_read, G_read, B_read, CLK);
    
    reg testPattern[383999:0] = 384000';
    
    integer i=0;
    initial begin
        while (i<3840000) 
            begin
            CLK <= 0;
            writeBus <= i;
            R_write <= (testPattern[i+7]*100 + testPattern[i+6]*10 + testPattern[i+5]);
            G_write <= (testPattern[i+4]*100 + testPattern[i+3]*10 + testPattern[i+2]);
            B_write <= (testPattern[i+1]*10 + testPattern[i]);
            index <= i;
            #1
            CLK <= 1;
            #1
            i=i+8;
        end
    
    end
    
endmodule
